import React from 'react'
import { Container, Row, Col } from 'react-bootstrap'


export default function ProfileRow({ name, value }) {
    return (
        <Container>
            <Row>
                <Col>{name}</Col>
                <Col>{value}</Col>
            </Row>
        </Container>
    )
}
